import React from 'react';
import url from "@assets/image/SliceAccount.png"

const ListProductUserSell = () => {
    return (
        <div>
            <div className=' flex border w-[600px] h-[150px] -translate-x-14 rounded-lg gap-x-5 mb-10' >
                <div className='centerAll ml-5'>
                    <img src={url} alt="" className='w-[100px] rounded-lg' />
                </div>
                <div className='translate-y-7'>
                    <h1 className=' text-[18px] font-bold mb-2'>Điện thoại Iphone 13</h1>
                    <div className='mb-2'>
                        <span>Price: </span>
                        <span>$560</span>
                    </div>
                    <div>
                        <span>Đã bán: </span>
                        <span>1056</span>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ListProductUserSell;
